                        "ThumbnailURL": "https://bookscape-s3-bucket.s3.amazonaws.com/product_images/9781847941831.jpg",
                        "longdesc": "<p><strong>The phenomenal international bestseller: over 10 million copies sold worldwide</strong></p>\n<p><strong>A New York Times and Sunday Times bestseller</strong></p>\n<p><em>Transform your life with tiny changes in behaviour, starting now.</em></p>\n<p>People think that when you want to change your life, you need to think big. But world-renowned habits expert James Clear has discovered another way. He knows that real change comes from the compound effect of hundreds of small decisions: doing two push-ups a day, waking up five minutes early, or holding a single short phone call. He calls them atomic habits.</p>\n<p>In this ground-breaking book, Clears reveals exactly how these minuscule changes can grow into such life-altering outcomes. He uncovers a handful of simple life hacks (the forgotten art of Habit Stacking, the unexpected power of the Two Minute Rule, or the trick to entering the Goldilocks Zone), and delves into cutting-edge psychology and neuroscience to explain why they matter. Along the way, he tells inspiring stories of Olympic gold medalists, leading CEOs, and distinguished scientists who have used the science of tiny habits to stay productive, motivated, and happy.</p>\n<p>These small changes will have a revolutionary effect on your career, your relationships, and your life.</p>\n<p><strong>Praises for <em>Atomic Habits</em>:</strong></p>\n<p>'A supremely practical and useful book.' <em>&mdash;Mark Manson, author of The Subtle Art of Not Giving A F*ck</em></p>\n<p>'James Clear has spent years honing the art and studying the science of habits. This engaging, hands-on book is the guide you need to break bad routines and make good ones.' <em>&mdash;Adam Grant, author of Originals</em></p>\n<p>'Atomic Habits is a step-by-step manual for changing routines.' <em>&mdash;Books of the Month, Financial Times</em></p>\n<p>'A special book that will change how you approach your day and live your life.' <em>&mdash;Ryan Holiday, author of The Obstacle is the Way</em></p>",
