                        "ThumbnailURL": "https://bookscape-s3-bucket.s3.amazonaws.com/product_images/9781786330895.jpg",
                        "longdesc": "<p><strong>The International Bestseller</strong></p>\n<p><br />We all have an <em>ikigai</em>. It's the Japanese word for 'a reason to live' or 'a reason to jump out of bed in the morning'. It's the place where your needs, desires, ambitions, and satisfaction meet. A place of balance. Small wonder that finding your ikigai is closely linked to living longer. Finding your ikigai is easier than you might think. This book will help you work out what your own ikigai really is, and equip you to change your life. You have a purpose in this world: your skills, your interests, your desires and your history have made you the perfect candidate for something. All you have to do is find it. Do that, and you can make every single day of your life joyful and meaningful.</p>\n<p><br /><em>Ikigai</em> gently unlocks simple secrets we can all use to live long, meaningful, happy lives. Science-based studies weave beautifully into honest, straight-talking conversation you won't be able to put down. Warm, patient, and kind, this book pulls you gently along your own journey rather than pushing you from behind.' Neil Pasricha, bestselling author of The Happiness Equation</p>\n<p><br />\"I read it and it's bewitched me ever since. I'm spellbound.\" <em>&mdash;Chris Evans</em></p>",
