                        "ThumbnailURL": "https://bookscape-s3-bucket.s3.amazonaws.com/product_images/9780099448822.jpg",
                        "longdesc": "<b>Read the haunting love story that turned Murakami into a literary superstar.</b><ul><li>When he hears her favourite Beatles song Toru Watanabe recalls his first love Naoko the girlfriend of his best friend Kizuki</li><li>Immediately he is transported back almost twenty years to his student days in Tokyo adrift in a world of uneasy friendships casual sex passion loss and desire - to a time when an impetuous young woman called Midori marches into his life and he has to choose between the future and the past</li><li>'Evocative entertaining sexy and funny but then Murakami is one of the best writers around' Time Out 'Such is the exquisite gossamer construction of Murakami's writing that everything he chooses to describe trembles with symbolic possibility' Guardian 'This book is undeniably hip full of student uprisings free love booze and 1960s pop it's also genuinely emotionally engaging and describes the highs of adolescence as well as the lows' Independent on Sunday|In 1978, Haruki Murakami was 29 and running a jazz bar in downtown Tokyo</li><li>One April day, the impulse to write a novel came to him suddenly while watching a baseball game</li><li>That first novel, Hear the Wind Sing, won a new writers’ award and was published the following year</li><li>More followed, including A Wild Sheep Chase and Hard-Boiled Wonderland and the End of the World, but it was Norwegian Wood, published in 1987, which turned Murakami from a writer into a phenomenon</li><li>His books became bestsellers, were translated into many languages, including English, and the door was thrown wide open to Murakami’s unique and addictive fictional universe.Murakami writes with admirable discipline, producing ten pages a day, after which he runs ten kilometres (he began long-distance running in 1982 and has participated in numerous marathons and races), works on translations, and then reads, listens to records and cooks</li><li>His passions colour his non-fiction output, from What I Talk About When I Talk About Running to Absolutely On Music, and they also seep into his novels and short stories, providing quotidian moments in his otherwise freewheeling flights of imaginative inquiry</li><li>In works such as The Wind-Up Bird Chronicle, 1Q84 and Men Without Women, his distinctive blend of the mysterious and the everyday, of melancholy and humour, continues to enchant readers, ensuring Murakami’s place as one of the world’s most acclaimed and well-loved writers.|Norwegian Wood is Japan's The Catcher in the Rye|Everyone who reads Norwegian Wood runs out to buy copies for friends and lovers..</li><li>Drawing on Fitzgerald, Capote, Chandler and the Japanese tradition, his books are at once disarmingly direct and slyly, charmingly evasive</li><li>They are playful and melancholy; full of wrong turns and red herrings, corridors that lead nowhere and - above all - girls who disappear|A masterly novel</li><li></li><li></li><li></li><li>Norwegian Wood bears the unmistakable marks of Murakami's hand|This book is undeniably hip, full of student uprisings, free love, booze and 1960s pop, it's also genuinely emotionally engaging, and describes the highs of adolescence as well as the lows|Catches the absorption and giddy rush of adolescent love..</li><li>It is also, for all the tragic momentum and the apparently kamikaze consciousness of many of its characters, often funny and quirkily observed</li><li>Quietly compulsive and finally moving|'A masterly novel' New York Times'Such is the exquisite, gossamer construction of Murakami's writing that everything he chooses to describe trembles with symbolic possibility' GuardianRead the haunting love story that turned Murakami into a literary superstar.When he hears her favourite Beatles song, Toru Watanabe recalls his first love Naoko, the girlfriend of his best friend Kizuki</li><li>Immediately he is transported back almost twenty years to his student days in Tokyo, adrift in a world of uneasy friendships, casual sex, passion, loss and desire - to a time when an impetuous young woman called Midori marches into his life and he has to choose between the future and the past.*Murakami's new book Novelist as a Vocation is available now*'Evocative, entertaining, sexy and funny; but then Murakami is one of the best writers around' Time Out'Poignant, romantic and hopeless, it beautifully encapsulates the heartbreak and loss of faith' Sunday Times'This book is undeniably hip, full of student uprisings, free love, booze and 1960s pop, it's also genuinely emotionally engaging, and describes the highs of adolescence as well as the lows' Independent on Sunday</li></ul>\n\nRead the haunting love story that turned Murakami into a literary superstar. When he hears her favourite Beatles song Toru Watanabe recalls his first love Naoko the girlfriend of his best friend Kizuki. Immediately he is transported back almost twenty years to his student days in Tokyo adrift in a world of uneasy friendships casual sex passion loss and desire - to a time when an impetuous young woman called Midori marches into his life and he has to choose between the future and the past. 'Evocative entertaining sexy and funny but then Murakami is one of the best writers around' Time Out 'Such is the exquisite gossamer construction of Murakami's writing that everything he chooses to describe trembles with symbolic possibility' Guardian 'This book is undeniably hip full of student uprisings free love booze and 1960s pop it's also genuinely emotionally engaging and describes the highs of adolescence as well as the lows' Independent on Sunday",
