                        "longdesc": "What Valuable Company is Nobody Building?. The next Bill Gates will not build an operating system. The next Larry Page or Sergey Brin won’t make a search engine. If you are copying these guys you aren’t learning from them. It’s easier to copy a model than to make something new doing what we already know how to do takes the world from 1 to n adding more of something familiar. Every new creation goes from 0 to 1. This book is about how to get there.\n\n<p>WHAT VALUABLE COMPANY IS NOBODY BUILDING?<br><br>The next Bill Gates will not build an operating system. The next Larry Page or Sergey Brin won’t make a search engine. If you are copying these guys, you aren’t learning from them. It’s easier to copy a model than to make something new: doing what we already know how to do takes the world from 1 to <i>n</i>, adding more of something familiar. Every new creation goes from 0 to 1. This book is about how to get there.<br><br>‘Peter Thiel has built multiple breakthrough companies, and <i>Zero to One </i>shows how.’<br>ELON MUSK, CEO of SpaceX and Tesla<br><br>‘This book delivers completely new and refreshing ideas on how to create value in the world.’<br>MARK ZUCKERBERG, CEO of Facebook<br><br>‘When a risk taker writes a book, read it. In the case of Peter Thiel, read it twice. Or, to be safe, three times. This is a classic.’<br>NASSIM NICHOLAS TALEB, author of <i>The Black Swan</i></p>",
