                        "longdesc": "‘As a Man Thinketh’ is a self-help book by James Allen (24th November 1864 – 24th January 1912). When Allen was just 15 years there happened a tragedy his businessman father was robbed and murdered. Due to this his family suffered huge financial crises. That compelled Allen to do some job so that he could support his family. Allen was highly inspired by the writings of Leo Tolstoy. After that along with his wife and daughter he shifted to Devon England. There he led a simple life and he wrote for 9 years resulted in 19 works. It was published in 1903. He was a British philosophical writer and poet known for his inspirational and self-help books. He was one of the most popular writers on spirituality. ‘As a Man Thinketh’ is an essay and self-help classic book. ‘As a Man Thinketh’ is an essay and self-help classic book. It narrates how one could make life better by harnessing his thoughts which further cultivates the philosophy and best attitude of a successful person. The author has kept this book very lucid simple and easy to understand language. The main focus is on giving power to your thoughts and thus making your life powerful. The book narrates how actions matter a lot? How thoughts help you act faster? So man is the master of thought the moulder of character and the maker of destiny. Mind is our master of inner and outer world. Our thoughts are the fountain of our life. Good thought always bring good in your life. Bad thoughts and actions never produce good & positive results. The author has nicely narrated how our mind is like a garden as good thoughts bear good fruit bad thoughts always a bad fruit. The aphorism– ‘As a man thinketh in his heart so is he’ is well suited to human’s life. Also man holds the key to every situation. Let this book show you how the way you think affects your daily life. You’ll learn how to be happier wealthier and lead a peaceful and stress free life. Also the book will surely help you to do self-analysis of your life. A must read book for everyone.",
