                        "longdesc": "When he turns I see his eyes. Theres a sense of surety in them a sense of danger a sense of entitlement and definitely arrogance.'Daksh and Aanchal meet under improbable circumstances in the most unlikely of places-a posh resort in the Andamans. While Aanchal is fighting hard to escape the shackles of a lower middle-class existence Daksh is aimless and unsure of what his future holds. Strangely they are drawn to each other.'My gaze drifts to her exposed back and the tiny knot that secures her shimmering choli in place. Emotions of anger mix with a strange desire in me.'Four years later when they meet again Daksh's world has crumbled around him. The burden of caring for his sick father and six-year-old sister has left him with little time for anything else. Yet despite their diverging paths Daksh and Aanchal find themselves reconnecting in unexpected ways. Their mutual attraction deepens.Till now fate has been pushing them together but what will happen when they decide to take matters into their own hands? Will life be as they've imagined or will destiny take even that away from them?",
