                        "title": "The World's Best Boyfriend",
                        "slug_field": "the-worlds-best-boyfriend-9780143424635",
                        "ThumbnailURL": "https://bookscape-s3-bucket.s3.amazonaws.com/product_images/9780143424635.jpg",
                        "longdesc": "<b>Durjoy Datta was born in New Delhi, and completed a degree in engineering and business management before embarking on a writing career.</b><ul><li>His first book-Of Course I Love You </li><li></li><li>.-was published when he was twenty-one years old and was an instant bestseller</li><li>His successive novels-Now That You're Rich </li><li></li><li>.; She Broke Up,I Didn't! </li><li></li><li>.; Oh Yes, I'm Single! </li><li></li><li>.; You Were My Crush </li><li></li><li>.; If It's Not Forever </li><li></li><li>.; Till the Last Breath </li><li></li><li>.; Someone Like You; Hold My Hand; When Only Love Remains; World's Best Boyfriend; The Girl of My Dreams, The Boy Who Loved; The Boy with the Broken Heart-have also found prominence on various bestseller lists, making him one of the highest-selling authors in India.Durjoy also has to his credit nine television shows and has written over a thousand episodes for television.He lives in Mumbai</li><li>For more updates, you can follow him on Facebook(www.facebook.com/durjoydatta1) or Twitter (@durjoydatta) or mail him at durjoydatta@gmail.com.|Hate, is a four letter word</li><li>So is love</li><li>And sometimes, people can't tell the difference..</li><li>Dhurv and Aranya spend a good part of their lives trying to figure out why they want to destroy each other, why they hurt each other so deeply</li><li>And, why they can't stay away from each other</li><li>The answer is just as difficult each time because all they've wanted is to do the worst, most miserable things to one another</li><li>Yet there is something that tells them: THIS IS NOT IT</li><li>If you want to know the answer to it all, read the book.|The author of 14 books, which have sold over 23 lakh copies, Durjoy Datta has been creating flawed characters with a propensity towards tortured romances and immense drama|At the core of all his novels is a love story and his young fan base has been growing by the day</li></ul>",
